import React from 'react'
import Video from '../../assets/bitgo.mp4';

const About = () => {
  return (
    <div className="aboutContainer">
      <h1>
        ¿Qué es Blockchain?
      </h1>

      <div>
      <video autoPlay style={{ height:"150%", width:"100%" }}>
            <source
              src={Video}
              type="video/mp4"
            />
          </video>
      </div>

    </div>
  )
}

export default About
